import React, { useState } from 'react';
import { Form, Button, Alert, Tabs, Tab, Spinner } from 'react-bootstrap';
import api from '../services/api';

const KycFatcaOperations = () => {
    const [activeTab, setActiveTab] = useState('kyc-register');
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState(null);
    const [success, setSuccess] = useState(null);
    const [selectedFile, setSelectedFile] = useState(null);
    const [formData, setFormData] = useState({
        // KYC Registration fields
        kycData: {
            panNumber: '',
            clientName: '',
            emailId: '',
            mobileNumber: '',
            gender: '',
            dateOfBirth: '',
            address: '',
            city: '',
            state: '',
            pincode: ''
        },
        // KYC Status Check fields
        kycCheck: {
            panNumber: '',
            clientCode: ''
        }
    });

    const handleInputChange = (section, field, value) => {
        setFormData(prev => ({
            ...prev,
            [section]: {
                ...prev[section],
                [field]: value
            }
        }));
    };

    const handleFileChange = (event) => {
        setSelectedFile(event.target.files[0]);
    };

    const handleKycRegistration = async (e) => {
        e.preventDefault();
        setLoading(true);
        setError(null);
        setSuccess(null);

        try {
            const response = await api.kycFreshRegister(formData.kycData);
            setSuccess('KYC Registration successful!');
            console.log('KYC Registration response:', response.data);
        } catch (err) {
            setError(err.response?.data?.error || 'Failed to register KYC');
        } finally {
            setLoading(false);
        }
    };

    const handleKycStatusCheck = async (e) => {
        e.preventDefault();
        setLoading(true);
        setError(null);
        setSuccess(null);

        try {
            const response = await api.kycStatusCheck(formData.kycCheck);
            setSuccess('KYC Status check successful!');
            console.log('KYC Status response:', response.data);
        } catch (err) {
            setError(err.response?.data?.error || 'Failed to check KYC status');
        } finally {
            setLoading(false);
        }
    };

    const handleFileUpload = async (endpoint) => {
        if (!selectedFile) {
            setError('Please select a file first');
            return;
        }

        setLoading(true);
        setError(null);
        setSuccess(null);

        const formData = new FormData();
        formData.append('file', selectedFile);

        try {
            let response;
            switch (endpoint) {
                case 'aof':
                    response = await api.aofImageUpload(formData);
                    break;
                case 'fatca':
                    response = await api.fatcaImageUpload(formData);
                    break;
                default:
                    throw new Error('Invalid endpoint');
            }
            setSuccess(`${endpoint.toUpperCase()} file upload successful!`);
            console.log(`${endpoint} upload response:`, response.data);
        } catch (err) {
            setError(err.response?.data?.error || `Failed to upload ${endpoint.toUpperCase()} file`);
        } finally {
            setLoading(false);
            setSelectedFile(null);
            // Reset file input
            const fileInput = document.getElementById('fileInput');
            if (fileInput) fileInput.value = '';
        }
    };

    return (
        <div className="kyc-fatca-operations">
            <Tabs
                activeKey={activeTab}
                onSelect={(k) => setActiveTab(k)}
                className="mb-3"
            >
                <Tab eventKey="kyc-register" title="KYC Registration">
                    <Form onSubmit={handleKycRegistration}>
                        <Form.Group className="mb-3">
                            <Form.Label>PAN Number</Form.Label>
                            <Form.Control
                                type="text"
                                value={formData.kycData.panNumber}
                                onChange={(e) => handleInputChange('kycData', 'panNumber', e.target.value)}
                                required
                            />
                        </Form.Group>
                        <Form.Group className="mb-3">
                            <Form.Label>Client Name</Form.Label>
                            <Form.Control
                                type="text"
                                value={formData.kycData.clientName}
                                onChange={(e) => handleInputChange('kycData', 'clientName', e.target.value)}
                                required
                            />
                        </Form.Group>
                        <Form.Group className="mb-3">
                            <Form.Label>Email</Form.Label>
                            <Form.Control
                                type="email"
                                value={formData.kycData.emailId}
                                onChange={(e) => handleInputChange('kycData', 'emailId', e.target.value)}
                                required
                            />
                        </Form.Group>
                        <Form.Group className="mb-3">
                            <Form.Label>Mobile Number</Form.Label>
                            <Form.Control
                                type="tel"
                                value={formData.kycData.mobileNumber}
                                onChange={(e) => handleInputChange('kycData', 'mobileNumber', e.target.value)}
                                required
                            />
                        </Form.Group>
                        <Button type="submit" disabled={loading}>
                            {loading ? (
                                <>
                                    <Spinner
                                        as="span"
                                        animation="border"
                                        size="sm"
                                        role="status"
                                        aria-hidden="true"
                                        className="me-2"
                                    />
                                    Processing...
                                </>
                            ) : (
                                'Register KYC'
                            )}
                        </Button>
                    </Form>
                </Tab>

                <Tab eventKey="kyc-status" title="KYC Status">
                    <Form onSubmit={handleKycStatusCheck}>
                        <Form.Group className="mb-3">
                            <Form.Label>PAN Number</Form.Label>
                            <Form.Control
                                type="text"
                                value={formData.kycCheck.panNumber}
                                onChange={(e) => handleInputChange('kycCheck', 'panNumber', e.target.value)}
                                required
                            />
                        </Form.Group>
                        <Form.Group className="mb-3">
                            <Form.Label>Client Code</Form.Label>
                            <Form.Control
                                type="text"
                                value={formData.kycCheck.clientCode}
                                onChange={(e) => handleInputChange('kycCheck', 'clientCode', e.target.value)}
                                required
                            />
                        </Form.Group>
                        <Button type="submit" disabled={loading}>
                            {loading ? (
                                <>
                                    <Spinner
                                        as="span"
                                        animation="border"
                                        size="sm"
                                        role="status"
                                        aria-hidden="true"
                                        className="me-2"
                                    />
                                    Processing...
                                </>
                            ) : (
                                'Check KYC Status'
                            )}
                        </Button>
                    </Form>
                </Tab>

                <Tab eventKey="aof-upload" title="AOF Upload">
                    <Form.Group className="mb-3">
                        <Form.Label>Select AOF File</Form.Label>
                        <Form.Control
                            type="file"
                            id="fileInput"
                            onChange={handleFileChange}
                            accept=".pdf,.jpg,.jpeg,.png"
                        />
                    </Form.Group>
                    <Button
                        onClick={() => handleFileUpload('aof')}
                        disabled={loading || !selectedFile}
                    >
                        {loading ? (
                            <>
                                <Spinner
                                    as="span"
                                    animation="border"
                                    size="sm"
                                    role="status"
                                    aria-hidden="true"
                                    className="me-2"
                                />
                                Uploading...
                            </>
                        ) : (
                            'Upload AOF'
                        )}
                    </Button>
                </Tab>

                <Tab eventKey="fatca-upload" title="FATCA Upload">
                    <Form.Group className="mb-3">
                        <Form.Label>Select FATCA File</Form.Label>
                        <Form.Control
                            type="file"
                            id="fileInput"
                            onChange={handleFileChange}
                            accept=".pdf,.jpg,.jpeg,.png"
                        />
                    </Form.Group>
                    <Button
                        onClick={() => handleFileUpload('fatca')}
                        disabled={loading || !selectedFile}
                    >
                        {loading ? (
                            <>
                                <Spinner
                                    as="span"
                                    animation="border"
                                    size="sm"
                                    role="status"
                                    aria-hidden="true"
                                    className="me-2"
                                />
                                Uploading...
                            </>
                        ) : (
                            'Upload FATCA'
                        )}
                    </Button>
                </Tab>
            </Tabs>

            {error && (
                <Alert variant="danger" className="mt-3">
                    {error}
                </Alert>
            )}

            {success && (
                <Alert variant="success" className="mt-3">
                    {success}
                </Alert>
            )}
        </div>
    );
};

export default KycFatcaOperations;
